description:
Rocky Balboa, heavyweight champion of the world, is the trainer for Apollo Creed in an exhibition match against Ivan Drago, a &quot;superman&quot; boxer from the Soviet Union. When Apollo is killed in the ring by the brutal Drago, Balboa blames himself and promises to avenge his friend's death in the ring.

